import { BrowserRouter,Routes,Route } from 'react-router-dom';
import './App.css';
import Header from './Component/Header';
import Footer from './Component/Footer';
import Home from './Pages/Home';
import Packages from './Pages/Packages';
import Docter_file from './Pages/Docter_file';
import Homecardic from './Component/Homecrdic/Homcardic';
import Homecardicepage from './Pages/Homecardicepage';
import Index2 from './Pages/Index2';
import Index3 from './Pages/Index3';
import Index4 from './Pages/Index4';
import Index5 from './Pages/Index5';
function App() {
  return (
    <div className="App">
    <BrowserRouter>
       <Header/>
        <Routes>
          <Route>
            <Route index element={<Home/>}/>
            <Route path='packges' element={<Packages/>}/>
            <Route path='Docter_file' element={<Docter_file/>}/>
            <Route path='Homecardic' element={<Homecardicepage/>}/>
            <Route path='Index2' element={<Index2/>}/>
            <Route path='Index3' element={<Index3/>}/>
            <Route path='Index4' element={<Index4/>}/>
            <Route path='Index5' element={<Index5/>}/>
          </Route>
        </Routes>
        <Footer/>
       </BrowserRouter>
    </div>
  );
}
export default App;
